subSubSection.paragraph:
Male genitalia (
Plate 11
). Uncus with socius of elaborate L-shape, valva with costa concave, saccus with clubbed end. Aedeagus simple, three times length of valva, gently curved, one long cornutus.

Female genitalia (
Plate 22
). Lamella postvaginalis with lobes extended and deeply divided, ductus about twice length of abdomen, signum star shaped.
